snippet.description:
A hunter having a hard time running away from a Giant Spider;
A knight charging through some Dwarfs on the mining grounds;
 
Thyranya is a Free-to-play MMORPG coming in Q2-2026. 

The game is inspired on the famous dungeon crawler Diablo, MOBA's like League of Legends and MMORPG's like Tibia.

Thyranya pre-alpha server is open for supporters! Visit our website to make a contribution and get unlimited access!

 Visit https://thyranya.com to learn more!

